import React from "react";
import { Form} from "react-bootstrap";
import Button from '@material-ui/core/Button';


export const ProfilData = (props) => {
    
  return (
      <div>
          <h1>Generelt</h1>
        <Form> {/*Generic skjema hentet fra nett */}
            <Form.Group>
                <Form.Label placeholder={props.user.userName}>
                    Name:</Form.Label>
                <Form.Control  />
            </Form.Group>
            <Form.Group controlId="formBasicEmail">
                <Form.Label>Email address</Form.Label>
                <Form.Control type="email" placeholder={props.user.userEmail} />
            </Form.Group>
            <Form.Group>
                <Form.Label>Endre bilde</Form.Label>
                <Form.Control type="email" placeholder="Enter email" />
            </Form.Group>
            <Form.Group controlId="formBasicCheckbox">
                <Form.Check type="checkbox" label="Check me out" />
            </Form.Group>
            <Button variant="primary" type="submit">
            Submit
        </Button>
        </Form>
    </div>
  );
};

export default ProfilData;
